import React from 'react';
import './style/App.css';
import TelaInicial from "./components/TelaInicial";

function App() {
    let rota = 'Login';
    return (
        <TelaInicial rota={rota} onCadastrar={event => rota = 'Cadastrar' }/>
    );
}

export default App;
